function AirportCard ({ image, alt, title, price }) {
	return(

	/*<article className="swiper-slide w-[286px] h-[440px] rounded-xl overflow-hidden flex flex-col justify-between hover:cursor-pointer group transition-all duration-300">
      		<img src={image} alt={alt} className="rounded-xl" />
   		<div className="card-text pt-6 font-bold">
			<h3 className=" text-[18px] leading-[28px] pb-[18px] text-navy transition-colors duration-300">
			{title}
			</h3>
			<p className="text-steel text-[16px] leading-[24px]">
			Airport Service Starting <br />
			from <span className="text-skyblue font-bold">{price}</span>
			</p>
    	</div>
    </article>*/


	<article class="card swiper-slide   w-[286px] h-[440px] rounded-[12px] overflow-hidden flex flex-col justify-between group">
		<div class="cart-img overflow-hidden rounded-[8px] h-[160px]">
			<img 
			src={image} 
			alt={alt} 
			className="w-full h-full object-cover rounded-[12px] transition-transform duration-400 ease-in-out group-hover:scale-95"
			/>
		</div>
		<div class="card-text   pt-6 font-bold">
			<h3 className=" text-[18px] leading-[28px] pb-[18px] text-navy transition-colors duration-300">{title}</h3>
			<p className="text-steel text-[16px] leading-[24px]">
				Airport Service Starting <br/>from <span class="price   text-skyblue font-bold">{price}</span>
			</p>
		</div>
	</article>

	);
}
export default AirportCard;
